package com.yaowang.lansha.entity;import java.io.Serializable;import java.util.Date;/** * log_user_login  * @author  *  */public class LogUserLogin implements Serializable{	private static final long serialVersionUID = 1L;		/**	 * id	 */	private String id;	/**	 * user_id	 */	private String userId;	private String userName;	/**	 * login_time	 */	private Date loginTime;	/**	 * login_ip	 */	private String loginIp;	/**	 * 登陆方式(0:app)	 */	private String loginMethod;	/**	 * 设置id	 */	 public void setId(String id){	 	this.id = id;	 }	 	 /**	  * 获取id	  */	 public String getId(){	 	return this.id;	 }	/**	 * 设置user_id	 */	 public void setUserId(String userId){	 	this.userId = userId;	 }	 	 /**	  * 获取user_id	  */	 public String getUserId(){	 	return this.userId;	 }	/**	 * 设置login_time	 */	 public void setLoginTime(Date loginTime){	 	this.loginTime = loginTime;	 }	 	 /**	  * 获取login_time	  */	 public Date getLoginTime(){	 	return this.loginTime;	 }	/**	 * 设置login_ip	 */	 public void setLoginIp(String loginIp){	 	this.loginIp = loginIp;	 }	 	 /**	  * 获取login_ip	  */	public String getLoginIp(){	 	return this.loginIp;	}		public String getUserName() {		return userName;	}	public void setUserName(String userName) {		this.userName = userName;	}	public String getLoginMethod() {		return loginMethod;	}	public void setLoginMethod(String loginMethod) {		this.loginMethod = loginMethod;	}}